import React, {Component} from 'react';
import Pager from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableHead from '@material-ui/core/TableHead';
import TableBody from '@material-ui/core/TableBody';
import TableRow from '@material-ui/core/TableRow';
import TableCell from '@material-ui/core/TableCell';
import {withStyles} from "@material-ui/core/styles";
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
const StyledTableCell = withStyles((theme) => ({
    head: {
        backgroundColor: theme.palette.common.black,
        color: theme.palette.common.white,
    },
    body: {
        fontSize: 14,
    },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
    root: {
        '&:nth-of-type(odd)': {
            backgroundColor: theme.palette.action.hover,
        },
    },
}))(TableRow);

const styles = theme => ({
    root: {
        width : '100%',
        minWidth : 1080,
        height : '100%',
        backgroundColor : '#eeeeee'
    },
    menu:{
        marginTop : 15,
        marginBottom : 15,
        display:'flex',
        justifyContent: 'center'
    },
    userTitle:{
        marginTop : 15,
        marginBottom : 15,
        justifyContent: 'center'
    },
    paper:{
        marginLeft: 18,
        marginRight: 18,
        marginTop : 18,
    },
    progress:{
        margin: theme.spacing(1) * 2
    },
    menuButton: {
        marginRight: theme.spacing(2),
    },
    title: {
        flexGrow: 1,
        display: 'none',
        [theme.breakpoints.up('sm')]: {
            display: 'block',
        },
    },
    subTitle:{
        flexGrow: 1,
        display: 'none',
        [theme.breakpoints.up('sm')]: {
            display: 'block',
        },
        marginLeft : 40,
        marginTop : 20,
        marginBottom : 20
    },
    tableHead:{
        fontSize: '1.5rem',
        justifyContent : 'center',
        textAlign : 'center',
        width : '20%',
        height: '25px',
        backgroundColor : '#f5fffa'
    }
})

class Page1 extends Component {
    render(){
        const {classes} = this.props;
        return (
            <div>
                문답지 이상 유무 현황

                <Pager className={classes.paper}>
                    <Table className={classes.table}>
                        <TableHead>
                            <TableRow>
                                <TableCell className={classes.tableHead}>교시</TableCell>
                                <TableCell className={classes.tableHead}>지원자</TableCell>
                                <TableCell className={classes.tableHead}>응시자</TableCell>
                                <TableCell className={classes.tableHead}>결시자</TableCell>
                                <TableCell className={classes.tableHead}>보고</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            <TableRow>
                                <TableCell>사대부고</TableCell>
                                <TableCell>신명고</TableCell>
                                <TableCell>경북여고</TableCell>
                                <TableCell>청구고</TableCell>
                                <TableCell>대구공고</TableCell>
                            </TableRow>
                        </TableBody>
                    </Table>
                </Pager>
            </div>
        )
    }
}

export default withStyles(styles)(Page1);
